import Banner_Homme from "../../assets/Banner_Home.png"
import styled from "styled-components"

const StyleBannerHome = styled.div`
width: 1240px;
left: 100px;
top: 171px;
border-radius: 25px;
`
const StyleTitre = styled.h1`
height: 68px;
width: 705px;
left: 373px;
top: 249px;
border-radius: nullpx;
font-family: Montserrat;
font-size: 48px;
font-weight: 500;
line-height: 68px;
letter-spacing: 0em;
text-align: left;
position: absolute;
color: #ffffff;
`
function BannerHome() {
    return (
      <StyleBannerHome>
        <img src={Banner_Homme} alt="Banner"/>
        <StyleTitre>Chez vous, partout et ailleurs</StyleTitre>
      </StyleBannerHome>
    )
  }

  export default BannerHome
